webpackJsonp([0x9c0d595a57a5],{765:function(A,e){A.exports={data:{markdownRemark:{headings:[],html:'<p>Toucandy is an environmentally and economically friendly children’s candy packaging that minimizes waste and provides a “second life” for the target audience to use.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Toucandy Package Design"\n        title=""\n        src="/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-35578.jpg"\n        srcset="/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-21994.jpg 375w,\n/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-f7c9d.jpg 750w,\n/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-35578.jpg 1500w,\n/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-7a0f9.jpg 2250w,\n/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-73713.jpg 3000w,\n/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-e1674.jpg 4500w,\n/the-next-website/static/toucandy1-01799a2d845748d8eede2ed537837ca4-85ef7.jpg 6000w"\n        sizes="(max-width: 1500px) 100vw, 1500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The goal of the project was to create a package design for an existing product that would function in a sustainable and beautiful way. <em>Toucandy</em> is candy for the target audience of young, imaginative children who love to play with their food. The design is made to be sustainable as it is made without the use of plastics—just paper. The package employs the use of folding techniques so that only a single swipe of glue is required to keep it together as well as the fact that it can be unfolded to create a bird hat for the consumer. Both parts of the box are collapsable and lightweight—thus saving economic resources on the transport of the material.</p>',frontmatter:{title:"Toucandy",graduate:"Terameet Kaur",category:"Package Design",category2:"Product Design",category3:null,image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-a7a62.jpg",srcSet:"/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-5a1a9.jpg 375w,\n/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-0908c.jpg 750w,\n/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-a7a62.jpg 1500w,\n/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-bda60.jpg 2250w,\n/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-cb414.jpg 3000w,\n/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-dc7f2.jpg 4500w,\n/the-next-website/static/toucandy2-64c96cb3c735373ca198e71c6c1f7ce9-eb4b3.jpg 6000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}}},pathContext:{slug:"/work/toucandy/",name:"/Toucandy/"}}}});
